import Header from "./components/Header/Header";
import MainContent from "./components/MainContent/MainContent";
import { Outlet } from "react-router-dom";

const MainPage = () => {
  return (
    <div style={{ padding: "50px 30px 30px 30px" }}>
      <Header />
      <MainContent>
        <Outlet />
      </MainContent>
    </div>
  );
};

export default MainPage;
